// SPDX-License-Identifier: GPL-3.0

pragma solidity 0.8.6;
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
//imported code from open zeppelin for safty purpose


interface structureOfERC {
//I created my own interface of having some feature..    

    function totalSupply() external view returns (uint256); // you can check total supply of created token.
    function balanceOf(address account) external view returns (uint256);// check the remaining balance of account holder
    function transfer(address  deposit, uint256 amount) external ;// can transfer the token to other
    
    event Transfer(address indexed from, address indexed to, uint256 value);
    //event trigger the notification if the function is done ."indexed" show more highligthled to user..
    
                        }


contract MyToken is structureOfERC {

//created the token with name , symbol ,decimal and totalsupply.
    string public  TokenName;
    string public  TokenSymbol;
    uint8 public  TokenDecimals;
    uint256 TokenTotalSupply;


    mapping(address => uint256) balances;//
    mapping (address => string)slabs;
    uint counter =1;
     

    // creating their own token from minter..
   constructor(string memory  _TokenName,string memory _TokenSymbol,uint8  _TokenDecimals,uint256 _TokenTotalSupply) 
   { 
     TokenName = _TokenName;
     TokenSymbol = _TokenSymbol;
     TokenDecimals = _TokenDecimals;
     TokenTotalSupply = _TokenTotalSupply;
    
     balances[msg.sender] = TokenTotalSupply;
   }

//You can check total supply of token and function got overrided from  interface.
    function totalSupply() public override view returns (uint256) 
    {
    return TokenTotalSupply;
    }

//total balance of token from any address holderand function got overrided from interface.
    function balanceOf(address tokenOwner) public override view returns (uint256)
    {
        return balances[tokenOwner];
    }

//can tranfer the token to one address holder to other address holder
    function transfer(address  depositTo, uint256 numOfTokens) public  override 
{
       bool flag = false;

// 
       if(balances[depositTo] == 0)
            {
            counter++;
            flag = true;
            }
        uint minToken = 1*(10**18);
        require(numOfTokens > minToken,"you have zero tokens");// condition should have more than one token
        require(numOfTokens <= balances[msg.sender],"Insufficient balance , check the balance");
        //transfering token  should be equal or lesser that balance[msg.sender]
        balances[msg.sender] = balances[msg.sender]-numOfTokens;//transfering token from sender
        balances[depositTo] = balances[depositTo]+numOfTokens;// Reciving token to reciver
       

// This check the deposit size and according to size of deposit the slab is solted
if(flag) {
     if(counter > 400 && counter <= 500){
         slabs[depositTo]="slab5";
     }else if(counter >300 && counter <= 400 ){
         slabs[depositTo]="slab4";
     }else if(counter >200 && counter <= 300 ){
         slabs[depositTo]="slab3";
     }else if(counter >100 && counter <= 200 ){
         slabs[depositTo]="slab2";
     }else if(counter >0 && counter <= 100 ){
         slabs[depositTo]="slab1";
     }
        }

}

//depositer can check the slab slot that he send..
    function depositorEnquires (address depositTo) public view returns(string memory)
    {
         slabs[depositTo] ;
        return  "slab5";
    }
   
}

